import "./App.css";
import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Header from "./Header";

import Home from "./Home";
import SignUp from "./SignUp";
import SignIn from "./SignIn";
// import UserDashboard from "./UserDashboard";
import AdminDashboard from "./AdminDashboard";
import DepartmentDashboard from "./DepartmentDashboard";

import UserDashboard from "./UserInterface/UserDashboard";

import ProductDisplay from "./UserInterface/ProductDisplay";
import MyProfile from "./UserInterface/MyProfile";
import MyComplaint from "./UserInterface/MyComplaint";
import PostComplaint from "./UserInterface/PostComplaint";

//import AdminRoute from "./AdminRoute";
// import UserRoute from "./UserRoute";
// import DepartmentRoute from "./DepartmentRoute";
import ProtectedRoute from "./ProtectedRoute";

import NotFound from "./NotFound";
const App = () => (
  <BrowserRouter>
    <Header />
    <main>
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route exact path="/SignIn" element={<SignIn />} />
        <Route exact path="/SignUp" element={<SignUp />} />
        {/* <Route exact path="/user/dashboard" element={<UserDashboard />}> */}

        <Route path="UserDashboard" element={<UserDashboard />}>
          <Route path="/user/dashboard/MyProfile" element={<MyProfile />} />
          <Route path="/user/dashboard/MyComplaint" element={<MyComplaint />} />
          <Route
            path="/user/dashboard/PostComplaint"
            element={<PostComplaint />}
          />
          <Route path=":id" element={<ProductDisplay />} />
        </Route>
        <Route
          exact
          path="/admin/dashboard"
          element={<ProtectedRoute Component={AdminDashboard} />}
        />
        <Route
          exact
          path="/department/dashboard"
          element={<DepartmentDashboard />}
        />

        <Route element={<NotFound />} />
      </Routes>
    </main>
  </BrowserRouter>
);

export default App;
